import React from 'react';

const Income = () => {
  return (
      <>
      <div className='containerleft'>
      <p>Income Variations</p>
      <img src="https://cdn.uarizonabootcamp.com/wp-content/uploads/sites/56/2020/05/front-end-developer-skills.jpg" alt="img"/>
      </div>
      </>
  );
};

export default Income;
